import axios from 'axios';

import {
   UPDATE_STOCK_DATA
} from './types';


export const updateStockData = () => async dispatch => {
   try {
      const res = await axios.get('/stockprices');
      console.log(res.data)
      dispatch({
         type: UPDATE_STOCK_DATA,
         payload: res.data
      });
   } catch(err) {
      console.log(err)
   }
}
